function Deals() {
 const [input , output] = useState('blue');
 const [name , setName] = useState('click me')
 const changeCol=()=>{
  let color = "#34495e";
  output(color);
 }
 return (
  <div >
   <button type="submit" className="button-adj"
   onClick={changeCol} style={{backgroundColor:input}}>{name}</button>
   <button type="submit" className="button-adj1">Selling</button>
  </div>
 )
}

export default Deals
